import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
height: 60px;
`

const wrapper = styled.div`
    padding:10px 20px;
`

const Navbar = () => {
  return (
    <Container>
        <wrapper>
            Navbar
        </wrapper>

    </Container>
  )
}

export default Navbar
